import React from "react";

class Navigation extends React.Component {
  render() {
    return (
      <div>
        <ul id="homeNav">
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/contact">Contact</a>
          </li>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/shop">Shop</a>
          </li>
          <li>
            <a href="/videos">Videos</a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Navigation;
